import React from 'react';
import './Scan.css'; 

function Scan() {
  return (
    <div className="container">
      <button className="button">Hall Ticket</button>
      <button className="button">Lunch</button>
      <button className="button">Kit</button>
    </div>
  );
}

export default Scan;
